import React from 'react';
import AdminLayout from '../../layouts/AdminLayout';
import VehicleManagement from '../../components/admin/VehicleManagement';

const AdminVehicles = () => {
  return (
    <AdminLayout>
      <div className="container mx-auto px-4 py-6">
        <VehicleManagement />
      </div>
    </AdminLayout>
  );
};

export default AdminVehicles;
